import React from "react";
import { storiesOf } from "@storybook/react";
import  GenericModal from "../GenericModal";

const ModalStoryArgs = {
    title: "Modal/GenericModal",
    component: GenericModal,
    args: {
        children: <h1>test</h1>,
        isOpen: true
    },
    argTypes: {
        isOpen: { control: "boolean", default: true },
        onClose: { action: "close" }
    }
};

const Template = (args) => (
    <GenericModal {...args}>
        <div style={{ width: 300, height: 300 }}>A</div>
    </GenericModal>
);

storiesOf("Components/ModalGeneric", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", Template, ModalStoryArgs);
